    "plt.title(\"Click a point to select seed for region growing\")\n",
    "plt.axis('off')\n",
    "\n",
    "# Function to handle mouse clicks\n",
    "seed = []\n",
    "\n",
    "def onclick(event):\n",
    "    if event.xdata is not None and event.ydata is not None:\n",
    "        x, y = int(event.ydata), int(event.xdata)\n",
    "        seed.clear()\n",
    "        seed.append((x, y))\n",
    "        plt.close()  # close the image once a point is clicked\n",
    "\n",
    "cid = plt.gcf().canvas.mpl_connect('button_press_event', onclick)\n",
    "plt.show()\n",
    "\n",
    "if not seed:\n",
    "    raise ValueError(\"âš ï¸ No seed selected! Please click on the image and run again.\")\n",
    "\n",
    "print(f\"âœ… Seed point selected: {seed[0]}\")\n",
    "\n",
    "# Region Growing Function\n",
    "def region_growing(img, seed, threshold=15):\n",
    "    h, w = img.shape\n",
    "    segmented = np.zeros_like(img, dtype=np.uint8)\n",
    "    seed_val = img[seed]\n",
    "    stack = [seed]\n",
    "    segmented[seed] = 255\n",
    "\n",
    "    while stack:\n",
    "        x, y = stack.pop()\n",
    "        for dx in [-1, 0, 1]:\n",
    "            for dy in [-1, 0, 1]:\n",
    "                nx, ny = x + dx, y + dy\n",
    "                if 0 <= nx < h and 0 <= ny < w and segmented[nx, ny] == 0:\n",
    "                    if abs(int(img[nx, ny]) - int(seed_val)) < threshold:\n",
    "                        segmented[nx, ny] = 255\n",
    "                        stack.append((nx, ny))\n",
    "    return segmented\n",
    "\n",
    "# Perform Region Growing\n",
